<node_2_id>.prompt:
You are given a question, context and answer. Your goal is to evaluate on the scale from 1 to 5 how relevant is the answer to the question and whether answer is grounded in the context. The score represents the fraction of claims in the output that are relevant to the question over total claims in the output. A high score means most retrieved content directly answers the question. A low score indicates excess or irrelevant information.

If answer seems correct, but it does not have any relevance to the context, grade it with a low score

If the context does not contain information related to the question, and the answer correctly acknowledges it, then give higher score.

Question:
{{question}}

Answer:
{{answer}}

Context:
{{context}}

